import Header from '../header/Header';
import Footer from '../footer/Footer';
import './AllRestaurants.scss';

const AllRestaurants = () => {
  return (
    <div>
        <Header />
        <h2>Restaurants</h2>
        <nav>
            <li>All</li>
            <li>New</li>
            <li>Most Popular</li>
            <li>Open Now</li>
        </nav>
        <div className='restaurants-grid'>

        </div>
    </div>
  )
}

export default AllRestaurants
